import React from "react";
import Item from "./Item";
import dashboardIcon from "../../icons/log_in.png";

const  AccountMenu = () => {
  
  return ( 
    <div>
      <Item
        text="Log in"
        icon={dashboardIcon}
        onClick={() => alert("Button clicked!")}
        className="custom-class"
      />
    </div>
   );
}
 
export default AccountMenu;
